import React from 'react';
import ReactDOM from 'react-dom';
import myFirebase from "../../firebase.js";

function SignIn(props){


  function handleSignIn(){
    let usernameTry,passwordTry;
    usernameTry = document.querySelector('#username').value;
    passwordTry = document.querySelector(`#password`).value;

    alert(`heh, nice try ${usernameTry}`)

  }


  return(
    <form onSubmit="handleSignIn">
      <label for="username"> Username:
        <input type="text" id="username" />
      </label>
      <label for="password"> Password:
        <input type="text" id="password" />
      </label>
      <input type="submit" onClick={handleSignIn} text="Submit" />

    </form>
  )

}
export default SignIn;
